JS{{
				var props = {}
				props.id = "modal_clone_" + $
				props.variables = {}
				props.variables.n = $
				props.value = false
				//props.visible = false
				let names = []
				let ipAddresses = []
				let macAddresses = []
				let bibi_binaires = []
				let computers = []
				let models = []
				let soundcards = []
				let comments = []
				let config = @{config}
				//console.log(config)
        config.computerInfo.forEach ((p, i) => {
          names.push(p.machineId)
          ipAddresses.push(p.ipAddress)
          macAddresses.push(p.macAddress)
          bibi_binaires.push(p.bibi_binaire)
          computers.push(p.machine)
          models.push(p.model)
          soundcards.push(p.soundcard)
          comments.push(p.comment)
        })
        props.variables.name = names[$]
				props.variables.ipAddress = ipAddresses[$]
				props.variables.macAddress = macAddresses[$]
				props.variables.bibi_binaire = bibi_binaires[$]
				props.variables.computer = computers[$]
				props.variables.model = models[$]
				props.variables.soundcard = soundcards[$]
				props.variables.comment = comments[$]

				return {
  			props: props,
  			widgetId: "module_template"
			}
		}}

