console.log(value);
let message = typeof value === "string" ? JSON.parse(value) : value 
let trackConfig = get('trackConfig')

if (message.target === "module")
 {
   let modules = trackConfig.modules;
   let moduleID = message.id;
   let cue =  message.cue;
   let thisModule = {}
   modules.forEach(function(m,i) {
      if (m.computerID === moduleID) {
        thisModule = m
      }
   })
   let thisCue = {}
   thisModule.cueList.forEach(function(c,i) {
      if (c.name === cue) {
        thisCue = c
      }
   })
   let slot =  message.slot;
   switch (message.command) {
     case "cue" :

       console.log("module " + moduleID + " wants cue " + cue + ' for slot ' + slot )
       thisCue.params.forEach(function(t,k){
        if (t.id === slot) {
          for (let key in t) {
            set(key + '_' + moduleID, t[key]);
          }
          set('sampleList_' + moduleID,t.sampleID);
        }
       })
       break;
     case "set" :
       let param = message.param
        console.log("module " + moduleID + " wants to set param " + param + " for cue " + cue + ' in slot ' + slot )
        switch (param) {
          case "musician" : 
            thisModule.Musician = message.value
            break;
          case "volume" :
            break;
          default :
        }
       if (thisModule.Instrument === "hexapad") {
         let thisSlot = {};
         if (param != "musician") {
          thisCue.params.forEach(function(s,i) {
            if (s.id === slot) thisSlot = s
          })
         }
        switch (param) {
          case "sampleID" :
            thisSlot.sampleID = parseFloat(message.value)
            break;
          case "Trigger" :
            thisSlot.trig = message.value
            break;
          case "playMode" :
            thisSlot.playMode = message.value
            break;
          case "fadeIn" :
            thisSlot.fadeIn = parseFloat(message.value)
            break;
          case "fadeOut" :
            thisSlot.fadeOut = parseFloat(message.value)
            break;
          case "gain" :
            thisSlot.gain = parseFloat(message.value)
            break;
          case "onset" :
            thisSlot.onset = parseFloat(message.value)
            break;
          case "loop" :
            thisSlot.loop = parseFloat(message.value)
            break;
          default :
        }
       }

       console.log("send config")
       set("trackConfig", trackConfig)
       send("localhost:5000","/saveTrackConfig",trackConfig)
       break;
     default :  
   }



 }
